description:
Movie Info: Singh Sahab the Great, sometimes called SSTG, is a Hindi action drama film directed by Anil Sharma. The film features Sunny Deol, Amrita Rao, Urvashi Rautela and Prakash Raj as main characters. The film was released on 22 November 2013.


